-- Volcando estructura para procedimiento pyaeve.PRO_HECHAUKA_COMPRAS_DETALLES
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `PRO_HECHAUKA_COMPRAS_DETALLES`(
	IN `_empresa_id` INT,
	IN `_id` INT,
	IN `f1` VARCHAR(50),
	IN `f2` VARCHAR(50)
)
BEGIN
select '2' as TipoReg ,
SPLIT_STR(FNC_DAME_RUC(t1.contribuyente), '-',1) as ruc,
SPLIT_STR(FNC_DAME_RUC(t1.contribuyente), '-',2) as dv,
FNC_DAME_CONTRIBUYENTE_NOMBRE(t1.contribuyente) as Proveedor,
t1.timbrado AS 'timbrado',
t1.doc_tipo as 'doc_tipo',
t1.doc_nro as 'doc_nro',
t1.fecha as 'fecha',
t1.gravadas_10 as 'gravadas_10',
t1.gravadas_total_10 'gravadas_total_10',
t1.gravadas_5 as  'gravadas_5',
t1.gravadas_total_5 as 'gravadas_total_5',
t1.total_exentas as 'exentas',
t1.total as total,
t1.tipo_operacion as 'tipo_operacion',
t1.condicion_compras as 'condicion',
t1.cuotas as 'cuotas'

  from libro_compras as t1
  where t1.cliente_id = _id and t1.empresa_id= _empresa_id and ( t1.fecha BETWEEN f1 and f2);

END//
DELIMITER ;

-- Volcando estructura para procedimiento pyaeve.PRO_HECHAUKA_VENTAS_DETALLES
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `PRO_HECHAUKA_VENTAS_DETALLES`(
	IN `_empresa_id` INT,
	IN `_cliente_id` INT,
	IN `_f1` VARCHAR(50),
	IN `_f2` VARCHAR(50)
)
BEGIN
SELECT '2' as TipoReg ,SPLIT_STR(TRIM(t1.ruc), '-',1) AS RUC, SPLIT_STR(TRIM(t1.ruc), '-',2) as DV,
FNC_DAME_CONTRIBUYENTE_NOMBRE(t1.proveedor) as Proveedor,t1.doc_tipo,t1.doc_nro,t1.fecha,
t1.gravadas_10,t1.gravadas_total_10,t1.gravadas_5,t1.gravadas_total_5,
t1.total_exentas,t1.total as total,t1.condicion_de_ventas,t1.cuotas,t1.timbrado
  FROM libro_ventas AS t1
  WHERE t1.cliente_id = _cliente_id AND t1.empresa_id = _empresa_id AND( t1.fecha BETWEEN _f1 AND _f2);

END//
