	IN `_empresa_id` INT,
	IN `_reg` VARCHAR(50)
)
BEGIN
	IF _reg='Todos' OR _reg ='todos' OR _reg='TODOS' THEN
		SELECT t1.id AS 'ID',
			 t1.regimen AS 'REGIMEN',
			 t1.`desc` AS 'CONTRIBUYENTE',
			 FNC_CONTRIBUYENTE_ES_CLIENTE(t1.empresa_id, t1.id) AS 'CLIENTE',
			 FNC_DAME_TIPO_DE_DOCUMENTACION(t1.tipo_doc_id) as 'TIPODOC',
			 FNC_DAME_CONTRIBUYENTE_TIPO(t1.id) AS 'TIPO',
			 t1.tipo_doc_id_codigo as 'NRODOC',
			 t1.direccion AS 'DIRECCION', 
			 t1.ciudad AS 'CIUDAD', t1.cel AS 'TEL', 
			 t1.email AS 'EMAIL', 
			 t1.timbrado_codigo AS 'TIMBRADO_NRO',
			 t1.timbrado_inicio AS 'TIMBRADO_INICIO',
			 t1.timbrado_fin AS 'TIMBRADO_FIN'
 		FROM contribuyente as t1
		WHERE t1.cliente=1 AND t1.empresa_id=_empresa_id
		ORDER BY t1.desc ASC;	
	ELSE
		SELECT t1.id AS 'ID',
			 t1.regimen AS 'REGIMEN',
			 t1.`desc` AS 'CONTRIBUYENTE',
			 FNC_DAME_TIPO_DE_DOCUMENTACION(t1.tipo_doc_id) as 'TIPODOC',
			 FNC_DAME_CONTRIBUYENTE_TIPO(t1.id) AS 'TIPO',
