-- Volcando estructura para procedimiento pyaeve.PRO_VER_CONTRIBUYENTE
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `PRO_VER_CONTRIBUYENTE`(
	IN `_eid` INT,
	IN `_cid` INT
)
BEGIN
		DECLARE tipo INT(11);
		SELECT t1.tipo_contribuyente FROM contribuyente AS t1 
		WHERE t1.id=_cid AND t1.empresa_id=_eid
		INTO tipo;
		IF tipo=1 THEN
			SELECT t1.id AS 'ID',
			t1.desc AS 'CONTRIBUYENTE',
			 FNC_DAME_TIPO_DE_DOCUMENTACION(t1.tipo_doc_id) as 'TIPODOC',
			 FNC_DAME_CONTRIBUYENTE_TIPO(t1.id) AS 'TIPO',
			 t1.tipo_doc_id_codigo as 'NRODOC',
			 t1.direccion AS 'DIRECCION', 
			 t1.ciudad AS 'CIUDAD', t1.cel AS 'TEL', 
			 t1.email AS 'EMAIL', 
			 t1.timbrado_codigo AS 'TIMBRADO_NRO',
			 t1.timbrado_inicio AS 'TIMBRADO_INICIO',
			 t1.timbrado_fin AS 'TIMBRADO_FIN'
 			FROM contribuyente as t1
			WHERE  t1.id=_cid AND t1.empresa_id=_eid;
		ELSEIF tipo=2 THEN
			SELECT t1.id AS 'ID',
			t1.desc AS 'CONTRIBUYENTE',
			 FNC_DAME_TIPO_DE_DOCUMENTACION(t1.tipo_doc_id) as 'TIPODOC',
			 FNC_DAME_CONTRIBUYENTE_TIPO(t1.id) AS 'TIPO',
			 t1.tipo_doc_id_codigo as 'NRODOC',
			 t1.direccion AS 'DIRECCION', 
			 t1.ciudad AS 'CIUDAD', t1.cel AS 'TEL', 
			 t1.email AS 'EMAIL', 
			 t1.timbrado_codigo AS 'TIMBRADO_NRO',
			 t1.timbrado_inicio AS 'TIMBRADO_INICIO',
			 t1.timbrado_fin AS 'TIMBRADO_FIN'
 			FROM contribuyente as t1
			WHERE  t1.id=_cid AND t1.empresa_id=_eid;
		END IF;
		
	

END//
DELIMITER ;

-- Volcando estructura para procedimiento pyaeve.PRO_VER_EGRESOS
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `PRO_VER_EGRESOS`(
	IN `_p` VARCHAR(50),
	IN `_c` INT
)
BEGIN
	SELECT 
		t1.periodo,
		t1.tipo,
		t1.relacionado_tipo_identificacion AS 'relacionadoTipoIdentificacion',
		t1.fecha, 
		t1.id,
		SPLIT_STR(t1.ruc, "-", 1) AS ruc,
		t1.egreso_monto_total AS 'egresoMontoTotal',
		t1.relacionado_nombres AS 'relacionadoNombres',
		SPLIT_STR(t1.relacionado_numero_identificacion, "-", 1) AS 'relacionadoNumeroIdentificacion',
		t1.timbrado_condicion AS 'timbradoCondicion',
		t1.timbrado_documento AS 'timbradoDocumento',
		t1.timbrado_numero AS 'timbradoNumero',
		t1.tipo_egreso AS 'tipoEgreso',
		t1.tipo_egreso_texto AS 'tipoEgresoTexto',
		FNC_DAME_TIPO_DOC_EGRESO(t1.tipo) AS 'tipoTexto',
	
		
		t1.sub_tipo_egreso AS 'subtipoEgreso',
			t1.sub_tipo_egreso_texto AS 'subtipoEgresoTexto',
			null AS 'numeroDespacho'
		
		
	FROM libro_egreso AS  t1
	WHERE t1.cliente_id=_c AND t1.periodo=_p;
	
END//
DELIMITER ;

