-- Volcando estructura para función pyaeve.FNC_DAME_CONTRIBUYENTES_TOTAL
DELIMITER //
CREATE DEFINER=`root`@`localhost` FUNCTION `FNC_DAME_CONTRIBUYENTES_TOTAL`(
	`_empresa_id` INT,
	`_tipo` INT,
	`_cliente` INT
) RETURNS int(11)
BEGIN
	DECLARE _total INT(11);
	IF _tipo=0 THEN
		IF _cliente = 0 THEN
			SELECT COUNT(t1.id) AS total FROM contribuyente AS t1 WHERE t1.cliente=0 AND t1.empresa_id=_empresa_id
			 INTO _total;
		ELSEIF _cliente=1 THEN
			SELECT COUNT(t1.id) AS total FROM contribuyente AS t1 WHERE t1.cliente=1 AND t1.empresa_id=_empresa_id INTO _total;	
		ELSEIF _cliente=2 then
				SELECT COUNT(t1.id) AS total FROM contribuyente AS t1 WHERE t1.empresa_id=_empresa_id INTO _total;
	
		END IF;
		
	
		
	ELSEIF _tipo=1 THEN
		IF _cliente = 0 THEN
			SELECT COUNT(t1.id) AS total FROM contribuyente AS t1 WHERE t1.clientw=0 AND  t1.tipo_contribuyente=_tipo AND t1.empresa_id=_empresa_id INTO _total;

		ELSEIF _cliente=1 then
			SELECT COUNT(t1.id) AS total FROM contribuyente AS t1 WHERE t1.clientw=1 AND  t1.tipo_contribuyente=_tipo  AND t1.empresa_id=_empresa_id INTO _total;
		ELSEIF _cliente=2 then
				SELECT COUNT(t1.id) AS total FROM contribuyente AS t1 WHERE t1.tipo_contribuyente=_tipo  AND t1.empresa_id=_empresa_id INTO _total;

		end if;
		
	ELSEIF _tipo=2 THEN
		IF _cliente = 0 THEN
			SELECT COUNT(t1.id) AS total FROM contribuyente AS t1  WHERE t1.clientw=0 AND t1.tipo_contribuyente=2  AND t1.empresa_id=_empresa_id INTO _total;

		ELSEIF _cliente=1 then
				SELECT COUNT(t1.id) AS total FROM contribuyente AS t1 WHERE t1.clientw=1 AND t1.tipo_contribuyente=2  AND t1.empresa_id=_empresa_id INTO _total;
		ELSEIF _cliente=2 then
				SELECT COUNT(t1.id) AS total FROM contribuyente AS t1 WHERE  t1.tipo_contribuyente=2  AND t1.empresa_id=_empresa_id INTO _total;

		END if;
		END IF;
	RETURN _total;
	
END//
DELIMITER ;

