-- Volcando estructura para función pyaeve.FNC_DAME_CONTRIBUYENTE_NOMBRE
DELIMITER //
CREATE DEFINER=`root`@`localhost` FUNCTION `FNC_DAME_CONTRIBUYENTE_NOMBRE`(
	`_id` INT
) RETURNS varchar(50) CHARSET utf8
BEGIN
	DECLARE ret VARCHAR(50);
	DECLARE tipo INT(11);
	-- traemos el tipo y comparamos
	SELECT t1.tipo_contribuyente FROM contribuyente AS t1 WHERE t1.id=_id INTO tipo;
	-- si es fisico
	IF tipo=1 THEN
		-- mostramos el nombre apellido concadenado del contriubuyebte
		SELECT t1.desc AS 'Contribuyente' FROM contribuyente AS t1 WHERE t1.id=_id INTO ret;
	-- si es juridico
	ELSEIF tipo=2 THEN
		-- mostramos la desc del  contriubuyebte
		SELECT t1.desc  AS 'Contribuyente' FROM contribuyente AS t1 WHERE t1.id=_id INTO ret;
	END IF;
	RETURN ret;
END//
DELIMITER ;

