-- Volcando estructura para función pyaeve.FNC_DAME_TOTAL_CLIENTES
DELIMITER //
CREATE DEFINER=`root`@`localhost` FUNCTION `FNC_DAME_TOTAL_CLIENTES`(
	`_empresa_id` INT,
	`_tipo` VARCHAR(50),
	`_reg` VARCHAR(50)
) RETURNS int(11)
BEGIN
	DECLARE _ret INT(11);
	set _ret=0;
	IF _tipo='Todos' OR _tipo='TODOS' OR _tipo='todos' THEN
			IF (_reg='Todos' OR _reg='TODOS' OR _reg='todos') THEN
				SELECT COUNT(*) AS total 
					FROM contribuyente AS t1
					WHERE t1.empresa_id=_empresa_id 
					and t1.cliente=1 
					INTO _ret;
			-- SINO
			ELSE
				SELECT COUNT(*) AS total 
					FROM contribuyente AS t1
					WHERE t1.empresa_id=_empresa_id AND t1.regimen=_reg
					and t1.cliente=1
					INTO _ret;
			END IF;
	ELSEIF _tipo='f' OR _tipo='F' OR _tipo='FISICO' OR _tipo='Fisico' THEN
			IF _reg='Todos' OR _reg='TODOS' OR _reg='todos' THEN
				SELECT COUNT(*) AS total 
					FROM contribuyente AS t1
					WHERE t1.empresa_id=_empresa_id AND 
							t1.cliente=1 AND t1.tipo_contribuyente=1
					INTO _ret;
			-- SINO 2
			ELSE
				SELECT COUNT(*) AS total 
					FROM contribuyente AS t1
					WHERE t1.empresa_id=_empresa_id AND
							t1.tipo_contribuyente=1 AND
							t1.cliente=1 AND
							t1.regimen=_reg
					INTO _ret;
			END IF;
	ELSEIF _tipo='j' OR _tipo='J' OR _tipo='JURIDICO' OR _tipo='Juridico' THEN
			IF _reg='Todos' OR _reg='TODOS' OR _reg='todos' THEN
				SELECT COUNT(*) AS total 
					FROM contribuyente AS t1
					WHERE t1.empresa_id=_empresa_id AND
							t1.cliente=1 AND t1.tipo_contribuyente=2
					INTO _ret;
			ELSE
				SELECT COUNT(*) AS total 
					FROM contribuyente AS t1
					WHERE t1.empresa_id=_empresa_id AND
							t1.tipo_contribuyente=2 AND
							t1.cliente=1 AND
							t1.regimen=_reg 
					INTO _ret;
			END IF;
	END IF;
	
	RETURN _ret;
	end//
DELIMITER ;

