-- Volcando estructura para función pyaeve.FNC_DAME_VENTAS_TOTAL
DELIMITER //
CREATE DEFINER=`root`@`localhost` FUNCTION `FNC_DAME_VENTAS_TOTAL`(
	`_empresa_id` INT,
	`_cliente_id` INT,
	`_f1` VARCHAR(50),
	`_f2` VARCHAR(50)
) RETURNS int(11)
BEGIN
DECLARE ret INT(11);
	SELECT SUM(t1.total)  AS total 
	FROM libro_ventas AS t1
	WHERE t1.cliente_id=_cliente_id AND t1.empresa_id =_empresa_id AND
	(t1.fecha BETWEEN _f1 AND _f2)
	INTO ret;
	RETURN ret;
END//
DELIMITER ;

