DELIMITER //
CREATE DEFINER=`root`@`localhost` FUNCTION `FNC_DAME_VINCULO_TEXTO`(
	`_id` INT
) RETURNS varchar(255) CHARSET utf8
BEGIN
	DECLARE ret VARCHAR(255);
	SELECT t1.desc FROM tipos_vinculo AS t1 WHERE t1.id=_id INTO ret;
	RETURN ret;
END//
DELIMITER ;

-- Volcando estructura para función pyaeve.SPLIT_STR
DELIMITER //
CREATE DEFINER=`root`@`localhost` FUNCTION `SPLIT_STR`(
	`str` TEXT,
	`delim` VARCHAR(50),
	`pos` INT
) RETURNS varchar(50) CHARSET utf8
    DETERMINISTIC
BEGIN 
    RETURN REPLACE(SUBSTRING(SUBSTRING_INDEX(str, delim, pos),
       LENGTH(SUBSTRING_INDEX(str, delim, pos -1)) + 1),
       delim, '');
END//
DELIMITER ;

